import React from 'react';
import { Link } from 'react-router-dom';

const AdminDashboard = () => {
  return (
    <div>
      <h2>Admin Dashboard</h2>
      <nav>
        <ul style={styles.navList}>
          <li style={styles.navItem}>
            <Link to="/admin/dashboard/addTours" style={styles.navLink}>Add Tours</Link>
          </li>
          <li style={styles.navItem}>
            <Link to="/admin/dashboard/manageBookings" style={styles.navLink}>Manage Bookings</Link>
          </li>
        </ul>
      </nav>
    </div>
  );
};

export default AdminDashboard;

const styles = {
  navList: {
    listStyleType: 'none',
    padding: 0,
    display: 'flex',
    justifyContent: 'center',
  },
  navItem: {
    margin: '0 10px',
  },
  navLink: {
    textDecoration: 'none',
    color: '#333',
    fontSize: '18px',
  },
};
